import React, { Component } from 'react'
import './footer.css'
import { Row, Col } from 'antd'


class Footer extends Component {
    render() {
        return (
            <div className="footer">
                <Row>
                    <Col span={6}>
                        <span className="foot-logo">南充场站强军网</span>
                        <span className="copyright">Copyright ©1999-2020 www.81.cn All Rights Reserved</span>
                    </Col>
                    <Col span={6}>
                    </Col>
                    <Col span={6}>3</Col>
                    <Col span={6}>4</Col>
                </Row>
            </div>
        )
    }
}

export default Footer;
